
def combine_elements_to_string(lst):
    return ''.join(map(str, lst))
def find_min_max_coordinates(coord_list):
    if len(coord_list) != 4:
        raise ValueError("Input should be a list of four coordinates [[x1, y1], [x2, y2], [x3, y3], [x4, y4]]")

    x_values, y_values = zip(*coord_list)

    x_min = min(x_values)
    y_min = min(y_values)
    x_max = max(x_values)
    y_max = max(y_values)

    return [x_min, y_min, x_max, y_max]
def create_bounding_box(coordinates):
    x_coordinates, y_coordinates = zip(*[coord for sublist in coordinates for coord in sublist])

    min_x, max_x = min(x_coordinates), max(x_coordinates)
    min_y, max_y = min(y_coordinates), max(y_coordinates)

    bounding_box = {
        "min_x": min_x,
        "max_x": max_x,
        "min_y": min_y,
        "max_y": max_y
    }
    # print(bounding_box)
    return([min_x,max_x,min_y,max_y])

def combine_boxes(boxes):
    if not boxes or not all(len(box) == 4 for box in boxes):
        return None

    # Transpose the list of boxes to get a list of x and y coordinates separately
    x_min_values, y_min_values, x_max_values, y_max_values = zip(*boxes)

    x_min_combined = min(x_min_values)
    y_min_combined = min(y_min_values)
    x_max_combined = max(x_max_values)
    y_max_combined = max(y_max_values)

    combined_box = (x_min_combined, y_min_combined, x_max_combined, y_max_combined)

    return combined_box



